import React from 'react'
import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <div>
        <nav className='py-4 bg-red-600 shadow-2xl'>
            <Link to='/'>
                <h1 className='text-3xl font-bold text-center text-white'>
                    Mov Mov Movie
                </h1>
            </Link>
        </nav>
    </div>
  )
}

export default Header;
